const DataSingleCountry = ({ countriesToShow }) => {

    let country = countriesToShow[0]
    let languages = country.languages
    let simplified = languages.map(language => language[1])
    console.log(simplified)

    return (
        <div>
            <h1> {country.name} </h1>
            <p> Capital: {country.capital}</p>
            <p> Area: {country.area}</p>
            <h2> Languages: </h2>
            <ul>     
            {languages.map(
                language => <p> {language[1]} </p> 
                )
            }
            </ul>
        </div>
    )
}

export default DataSingleCountry
